import React from "react";
import s from './FormControl.module.css';

const Textarea = (props) => {
    return (
        <div className={s.formControl+ ""+ s.error}>
            <textarea input={props.input} placeholder={props.placeholder}/>
        </div>
    )
}
export default Textarea;
